	GetChannelLastPtsHandle(context.Context, *ReqGetChannelLastPtsHandle) (*ReplyGetChannelLastPtsHandle, error)
	// 删除ptsHandle
	DeleteChannelPtsHandle(context.Context, *ReqDeleteChannelPtsHandle) (*ReplyDeleteChannelPtsHandle, error)
