	UpdateChannelMsg(context.Context, *ReqUpdateChannelMsg) (*ReplyErr, error)
	// 批量存储消息
	BatchInsertOrUpdateChannelMsg(context.Context, *ReqBatchInsertOrUpdateChannelMsg) (*ReplyErr, error)
