	DeleteUserHistory(context.Context, *ReqDeleteUserHistory) (*ReplyDeleteUserHistory, error)
	// 删除超级群所有消息
	DeleteChannelMsg(context.Context, *ReqDeleteChannelMsg) (*ReplyErr, error)
